              isSyncing[targetId] = false;
            });
          });
        }

        if (e['xaxis.autorange']) {
          others.forEach(targetId => {
            isSyncing[targetId] = true;
            Plotly.relayout(targetId, { 'xaxis.autorange': true }).then(() => {
              isSyncing[targetId] = false;
            });
          });
        }
      });
    });
  </script>
</body>
</html>
